import React, { Component } from 'react';

class App extends Component {
   
    constructor(props) {
        super(props);
    }
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <a
            className="App-link"
            href="./public/show.html"
            target="_blank"
            rel="noopener noreferrer"
          >
            {this.props.name}
          </a>
        </header>
      </div>
    );
  }
}

export default App;
